Information
------------------------------

Following the retirement of Lance Armstrong in 2006 there was an opening for another rider to come through and stamp his authority on the Tour de France. Alberto Contador stepped forward to fill the void and record his first Tour victory in a year when drug scandals were rife, with Michael Rasmussen being sent home and the entire Astana team being disqualified.
2008 was all about the 'Manx Missile', Mark Cavendish, who emerged as one of the new stars of the Tour after recording four stage wins. 2009 was a good year for another British rider, Bradley Wiggins, who by finishing 4th became the highest placed Briton ever in the General Classification. Meanwhile, Contador triumphed on the Ventoux to guarantee his second Yellow Jersey while Cavendish enhanced his reputation as a world-class sprinter as he recorded six stage wins.
Cavendish sealed his status as one of the great sprinters in world cycling in the 2010 Tour, adding another five stage victories to take his overall tally to 15. But the battle for General Classification victory was between Contador and Andy Schleck, with Contador eventually picking up his third Tour win under controversial circumstances after Schleck lost his chain on stage 15. Contador cycled ahead to take Yellow and record a victory margin of a mere 39 seconds in one of the closest finishes in history, setting the stage for what could become one of the great Tour rivalries.

